export const typesPosts = {
    POST: {
      PUSH: 'POST.PUSH',
      GET: 'POST.GET'
    },
  }


  
  export const postPush = (email, postHeadline, postText) => ({
    type: typesPosts.POST.PUSH,
    email,
    postHeadline,
    postText,
  })
  
  export const postGet = data => ({
    type: typesPosts.POST.GET,
    data
  })
